INSERT INTO `places` VALUES (1,'Maison Boulud','Elegant eatery at The Ritz-Carlton featuring upscale French fare & tables overlooking the garden.','Ritz-Carlton Montreal, 1228 Sherbrooke St W, Montreal, QC H3G 1H6','http://placehold.it/350x350','2017-04-06 22:15:33','2017-04-06 22:15:33',45.5000579,-73.5802808,'4.7'),(2,'Damas Restaurant','Creative Syrian delicacies in a Persian-influenced space with a plant-trimmed terrace.','1201 Ave Van Horne, Outremont, QC H2V 1K4','http://placehold.it/350x350','2017-04-06 22:15:33','2017-04-06 22:15:33',45.5225522,-73.6832877,'4.6'),(3,'Les Deux Singes de Montarvie','Buzzy spot for creative French dishes & a stylish space decorated with eclectic local artwork','176 Saint Viateur West Street, QC 2L3, St Viateur St W, Montreal, QC H2T 2L3','http://placehold.it/350x350','2017-04-06 22:15:33','2017-04-06 22:15:33',45.5215878,-73.6082513,'4.8'),(4,'BOUILLON BILK','Modern eclectic cuisine with a French influence served in a bright, minimalist-chic space.','1595 St Laurent Blvd, Montreal, QC H2X 2S9','http://placehold.it/350x350','2017-04-06 22:15:33','2017-04-06 22:15:33',45.5109921,-73.5680999,'4.7'),(5,'Modavie','Wine bar with live music & an old-timey jazz vibe, plus an eclectic menu with lamb specialties.','1 Saint-Paul St W, Montreal, QC H2Y 1Y6','http://placehold.it/350x350','2017-04-06 22:15:33','2017-04-06 22:15:33',45.5054732,-73.5561330,'4.2'),(6,'Muzique','Muzique\'s already been featured in a New York Magazine as a hot spot destination in the North American party capital and hosting celebrities such as Vin Diesel, Guns N Roses, Tiesto, Avicii, Laidback Luke, Cypress Hill and DJ Deadmau5. They have quickly earned the reputation as a global hot spot.','3781 St-Laurent Blvd., Montreal','http://www.xplorocity.ca/partners/uploads/191/muzique2.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5154218,-73.5778727,'4'),(7,'New City Gas','New City Gas is not only one of the hottest partying spots in Montreal, but it\'s also one of the city\'s most breathtaking venues that hosts amazing talent and functions. The building\'s a 19th century landmark that was first used to transform coal to light up Quebec\'s Metropolis.','950 Ottawa St., Montreal','http://www.lestubbies.com/sites/default/files/styles/article_600x600/public/images/nouvelles/ncg_21nov14.jpg?itok=0Gxa0z6m','2017-04-06 22:15:34','2017-04-06 22:15:34',45.4953158,-73.5595851,'4.5'),(8,'Tokyo','Since 1997 when they first opened, Tokyo bar has quickly staked its claim as one of Montreal’s premier night life venue. They offer one of the city’s best terraces, friendliest staffs and progressive DJ lineups.','3709 St-Laurent Blvd., Montreal','http://directory.oboxeditions.com/sites/prod_directory/files/styles/largehd/public/place/tokyo-bar-755.jpg?itok=nzUOsmrG','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5149682,-73.5767937,'4'),(9,'Rouge','Rouge Bar has been voted as one of Montreal\'s best nightclubs for almost 8 years with two floors, the city\'s best DJs, a relaxed atmosphere, and personable service. They are open on Friday and Saturday nights.','7 Prince Arthur St. W., Montreal','http://s3.amazonaws.com/nightclubs/rb/assets/_mg_3768___standard.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5136831,-73.5750496,'3.5'),(10,'Blvd44','Montreal’s most upscale and chic club experience to-date. Opened in 2011, Blvd44 is a lavish escape from traditional night life. They provide Montreal with a classy, but modern space to entertain both clients and friends. ','2108 St-Laurent Blvd., Montreal','http://www.blvd44montreal.com/wp-content/uploads/2015/07/blvd44-v3.png','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5121450,-73.5711297,'3.5'),(11,'Dollar Cinema','Dollar Cinema is located in the old deserted mall of Decarie Square. The selection of movies are usually 2nd-run movies that came out a couple months ago. Admission was only 1$ but it went up to 2.50$, which is still cheap by today\'s standards. The good thing is, all the candies are 1$ each.','6900 Decarie Blvd., Montreal','https://mtlblog-odqaldqcratf2.stackpathdns.com/uploads/228216_dacabdadb9d8ce8d4815dc0e8f5c87c9a7166da0.png','2017-04-06 22:15:34','2017-04-06 22:15:34',45.4909060,-73.6529557,'4'),(12,'Syn Studio Drawing Workshop','This is a monthly event and those who wish to attend draw a live model for only 10$. Syn Studio is located right beside the bar Foufounes Electriques so you can stop by and get hammered after hours of intense drawing.','460 Saint-Catherine St W #508, Montreal','http://static.cms.yp.ca/ecms/media/1/3.Syn-Studio.514.998.7625.environment-700x500.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5049799,-73.5698639,'3'),(13,'MBAM Wednesday Evenings','Montreal Museum of Fine Arts is always hosting amazing exhibitions. On Wednesdays after 5:00pm, it only costs 10$. Some featured collections include: Archeology and World Cultures, Early to Modern International Art, and Photography and Graphic Arts. ','1380 Sherbrooke St. W., Montreal','https://mtlblog-odqaldqcratf2.stackpathdns.com/uploads/229037_b1bc7c3a5629ca4177e916a08da5f406cee321ec.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.4985219,-73.5815888,'3'),(14,'Ceramic Café','The Ceramic Cafe in Montreal is made up of 2 floors and can accommodate up to 100 people. They offer ceramic painting activities to groups such as school, enrichment programs, summer camps, office parties, bridal showers, children’s birthday parties and other occasions. It only costs 8$/hr for adults and 6$/hr for children under 17 years old.','4338 St Denis, Montreal','http://leccs.com/wp-content/uploads/2012/01/ceramic-cafe-montreal-12.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5226467,-73.5804306,'3.5'),(15,'Hot Yoga At Enso','Sit back and relax with your special someone by doing some hot yoga. Hot yoga is a great way to relax and release stress and at Enso it only costs $10 for community classes.','1470 Peel St #100, Montreal','http://ensoyoga.ca/wp-content/uploads/2013/08/enso-slider-studio-front.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5005628,-73.5766466,'3'),(16,'La Banquise','La Banquise is open 24 hours and always packed. They serve delicious poutine with over 20 different types and they always know how to hit the spot.','994 rue Rachel E., Montreal','https://restosmtl.files.wordpress.com/2014/03/la-banquise-poutine-590.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5253521,-73.5769568,'4'),(17,'Orange Julep','Orange Julep opened in 1932 and has been recognizable landmark of Montreal ever since. Open until around 3:00am every night, Orange Julep makes the perfect poutine accompanied by a delicious frothy orange drink.','7700 Decarie Blvd., Montreal','https://s3-media1.fl.yelpcdn.com/bphoto/73Z_c-4Ws53IjApXrZe8vA/o.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.4956948,-73.6588862,'4'),(18,'Poutineville','Poutineville\'s specialty poutine is topped with cheese curds, mozzarella, braised beef and wine sauce. They also have several other specialty poutines with toppings such as Italian sausage, marinated eggplant, batter fried pickle and more.','1365 Ontario St. E., Montreal','http://2.bp.blogspot.com/-dtwOxxl-fX0/U_FjZeudF6I/AAAAAAAAIKM/THTjhuwIfbk/s1600/IMG_4562.JPG','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5232038,-73.5634875,'3.5'),(19,'Au Pied De Cochon','Au Pied De Cochon\'s poutine isn\'t your average poutine. They specialize in foie gras and combine that with poutine, you get a delicious foie gras poutine, which is known to be one the best in Montreal. For only $7, their poutine will fill you up for a whole day.','536 Duluth E., Montreal','http://www.foodandwinechickie.com/wp-content/uploads/2010/09/Pied-de-Cochon-Poutine.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5221677,-73.5766376,'4'),(20,'Frite Alors','Frite Alors specializes in their hand cut Belgium style french fries, but their poutine is just as good. There are 8 styles of poutine to choose from, including a tasty poutine topped with steak, mushshrooms, and fried onions.','1710 St-Denis St., Montreal','https://jackbidule.files.wordpress.com/2016/12/frite-alors-15.jpg?w=660','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5154019,-73.5666150,'4'),(21,'Vua Sandwiches','Vua Sandwiches is a fantastic option to avoid fast food. And, you can also have a delicious smoothie, bubble tea or dessert with your meal. All of these items are our specialty!','AXA Center, 2020 Boulevard Robert-Bourassa, Montreal, QC H3A 2A5','http://vuasandwichs.com/wp-content/uploads/2015/09/hs_0009.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5043560,-73.5724327,'4.6'),(22,'St-Viateur Bagel','Iconic 24-hour storefront known for wood-oven baked bagels with varied flavors & toppings. ','263 Rue Saint Viateur O, Montréal, QC H2V 1Y1','http://media3.trover.com/T40bc9ec26c48d6e6a000cf6/fixedw.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5226627,-73.6017851,'4.6'),(23,'Restaurant Nilufar','Modest, self-serve Middle Eastern outfit known for its falafel, with soups, dips & merguez.','1923 Saint-Catherine St W, Montreal, QC H3H 1M3','https://lh3.ggpht.com/-e99HyXd0SHs/VtIU66T4hJI/AAAAAAAAyjk/mMnOQHKUao034wlIut4jpk0990lkXNm5wCJkC/s1024/photo','2017-04-06 22:15:34','2017-04-06 22:15:34',45.4951870,-73.5798532,'4.5'),(24,'Patati Patata Friterie De Luxe','Tiny diner with a colourful facade & counter seating for breakfast, espresso, mini-burgers & beer. ','4177 St Laurent Blvd, Montreal, QC H2W 1Y7','https://lh3.ggpht.com/-5xcDd_U7kxA/WDUD5GpdcGI/AAAAAAAAkqA/lguLJwLg4v8jsMBIlJDakbMEL0pS-pQ_ACLIB/s1024/photo','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5180783,-73.5815466,'4.5'),(25,'La Chilenita','Relaxed restaurant dishing up traditional Chilean & Mexican cuisine in a simple setting.','130 Rue Roy E, Montréal, QC H2W 1L9','https://lh3.ggpht.com/-1uj4voRw6oI/VNpSIiEkS5I/AAAAAAAAABo/7gfVBuGMWTsdCOAVO2cOKK4S3_MOgvO2gCJkC/s1024/photo','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5177229,-73.5766008,'4.6'),(26,'Mont Royal','Mont-Royal rises 233 meters above the city and is the green lung near the city center. A stroll through this lovely park enables the visitor to see monuments to Jacques Cartier and King George VI, to spend some time by Lac-aux-Castors, and to have a look at the cemeteries on the western slope where the city\'s different ethnic groups have rested in peace together for centuries. From the summit, or rather from a platform below the cross, there unfolds a magnificent panorama of the whole of the 51-kilometer length of the Île de Montréal and the St. Lawrence. On clear days, the view extends to the Adirondack Mountains in the United States of America.','Montreal, QC','http://www.planetware.com/photos-large/CDN/canada-montreal-mont-royal-2.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5071024,-73.5895959,'4.5'),(27,'Old Montreal','Old Montréal is a remarkable concentration of buildings dating from the 17th, 18th, and 19th centuries. The district has the delightful feel of a Parisian-style quarter, situated as it is between the waterfront and the business hub. Its many historic sites, streets, and landmarks are best explored on foot. Those not to miss include the twin towers of Notre-Dame Basilica, the quays of the revitalized Old Port, and the open-air gathering space of Place Jacques-Cartier.','303 Notre-Dame St E, Montreal, QC H2Y 3Y8','http://www.planetware.com/photos-large/CDN/canada-montreal-old-montreal.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5094660,-73.5556485,'4.6'),(28,'Parc Jean Drapeau','Île Sainte-Hélène (named after the wife of Samuel de Champlain) and the artificial island of Notre-Dame were the site of Expo \'67. They are now known as Parc Jean Drapeau and have many family-minded attractions. A remnant of the 1967 world fair, the Biosphere is now a museum dedicated to ecological issues. The building is designed in the shape of a sphere and is the largest such structure in the world. Other tourist attractions on the islands include the rides and games of La Ronde Amusement Park, the historic 1820 British arsenal at the Stewart Museum, Bassin Olympique (where the Olympic rowing events were held), and race course Circuit Gilles Villeneuve.','Montréal, QC H3C 4G8','http://www.planetware.com/photos-large/CDN/canada-montreal-ile-sainte-helene.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5144495,-73.5412062,'4.8'),(29,'Botanical Garden','Parc Maisonneuve (Pie IX Metro) incorporates the wonderfully imaginative botanical garden. At Jardin Botanique, visitors are drawn in particular to the Japanese and Chinese Gardens, exceptional glasshouses, and displays of orchids and bonsai. There is an interesting Insectarium and huge arboretum on the grounds, as well as ponds supporting a variety of birds.','4101 Sherbrooke St East, Montréal','http://www.planetware.com/photos-large/CDN/canada-montreal-botanical-garden-2.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5600055,-73.5651976,'4.7'),(30,'St. Joseph\'s Oratory','The Oratoire Saint-Joseph in Montréal, near the western exit from Mount Royal Park, is dedicated to Canada\'s patron saint. It is a mecca for pilgrims, with its huge Renaissance-style domed basilica dating to 1924. Brother André of the Congrégation de Sainte-Croix had already built a small chapel here in 1904, where he performed miraculous acts of healing for which he was canonized in 1982. His tomb is in one part of the sanctuary in the original chapel. Votive gifts are displayed in a second chapel. A cloister behind the church leads up to Mont-Royal. There is a good northwest view from the observatory over Montréal and Lac Saint-Louis.','3800 Queen Mary, Montréal','http://www.planetware.com/photos-large/CDN/canada-montreal-st-josephs-oratory.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.4925772,-73.6205277,'4.3'),(31,'Square Saint-Louis','Near the Sherbrooke Metro Station, Square Saint-Louis rates as one of Montréal\'s prettiest old squares and is set in a turn-of-the-century French-Canadian residential quarter. In the little streets around the tree-shaded square, there are still a few attractive Victorian houses. Some now house pleasant restaurants','Montreal, QC','http://www.planetware.com/photos-large/CDN/canada-montreal-square-saint-louis.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5168665,-73.5722071,'4.6'),(32,'Baskin Robbins','Free scoop of ice cream','705 Rue Ste-Catherine O, Montreal, QC H3A 3T2','http://itsallfreeonline.com/wp-content/uploads/2016/11/baskin-robbins-free-scoop-we-love-couponing.png','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5032200,-73.5723430,'4.3'),(33,'Montreal Jazz Festival','Free outdoor concerts','De Bleury / Sainte-Catherine, Montreal, QC H3B 1A4','http://medias.quartierdesspectacles.com/import/vitrine/event.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5063130,-73.5669230,'4'),(34,'Ice Skating at Lafontaine Park','Ice skating on the park\'s pond','3528 Avenue Calixa-Lavallée, Montréal, QC H2L 2T6','http://localmontrealtours.com/wp-content/uploads/2014/01/patinoire-parc-lafontaine.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5248770,-73.5669690,'3.8'),(35,'Montreal Museum of Fine Arts','Most exhibitions are free','1380 Sherbrooke St W, Montreal, QC H3G 1J5','http://museesmontreal.org/data/km2fsRfO/mbam.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.4986040,-73.5797600,'3.9'),(36,'Montreal en Lumiere festival','Some free outdoor activities involving spectacular lighting displays','400 Boulevard de Maisonneuve O, Montréal, QC H3A 1L4','http://www.tourisme-montreal.org/blog/wp-content/uploads/2015/01/MONTREAL_EN_LUMIERE-1-625X417.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5060760,-73.5688360,'4.2'),(37,'Chalet du Mont-Royal','Lookout spot on Mount Royal','1196 Voie Camillien-Houde, Montréal, QC H3H 1A1','https://media-cdn.tripadvisor.com/media/photo-s/0d/41/97/6e/vue-du-chalet-mont-royal.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5039220,-73.5876510,'4.7'),(38,'Olympic Stadium','It\'s tower with a very scenic view','4141 Pierre-de Coubertin Ave, Montreal, QC H1V 3N7','https://c2.staticflickr.com/4/3099/3155701067_96cf009dde_z.jpg?zz=1','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5582660,-73.5522300,'4.6'),(39,'Belvedere Camillien-Houde','Lookout spot on Mount Royal','Mount Royal, Montréal, QC H3R 1K2','https://i.cbc.ca/1.3125576.1435148121!/fileImage/httpImage/image.jpg_gen/derivatives/16x9_620/camilien-houde-belvedere-lookout-mont-royal.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5104340,-73.5926030,'4.4'),(40,'Terrasse sur l\'Auberge','Restaurant with great view of Old Port','97 de la Commune St E, Montreal, QC H2Y 1J1','http://www.therooftopguide.com/rooftop-bars-in-montreal/Bilder/TerrasseSurLAuberge_3_slide.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5063370,-73.5527170,'4.9'),(41,'Sainte-Anne-de-Bellevue Canal National Historic Site','Canal in the Sainte-Anne-de-Bellevue village','170 Sainte-Anne St, Sainte-Anne-de-Bellevue, QC H9X 1N1','https://www.quebecoriginal.com/en/listing/images/800x600/c6517e2d-28ed-4503-ab7b-e2d7c7e9e1a4/sainte-anne-de-bellevue-canal-national-historic-site-of-canada-photo.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.4046410,-73.9558780,'4.5'),(42,'Osheaga','Music concerts','25 Chemin Macdonald, Montréal, QC H3C 6A3','https://www.mtlblog.com/uploads/306021_b4169f81a0fddff86c6a9987ffc9275aba8ad80a.png','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5112480,-73.5328380,'4.6'),(43,'Igloofest','Electronic music festival in the winter','de la Commune St E, Montreal, QC H2Y 0B1','http://www.tourisme-montreal.org/blog/wp-content/uploads/2015/01/igloofest-625x4001.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5073300,-73.5503020,'4.7'),(44,'Beerfest','Tasting beers of the world','201 Viger Ave W, Montreal, QC H2Z 1H2','https://upload.wikimedia.org/wikipedia/commons/7/77/GBBF_full.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5053740,-73.5606860,'4.2'),(45,'Montreal Grand Prix','Formula 1 Racing','Parc Jean-Drapeau, Montréal, QC H3C 6A1','http://www.tourisme-montreal.org/blog/wp-content/uploads/2014/03/Grand-Prix-Montreal.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5034160,-73.5267460,'3.9'),(46,'Montreal Electronic Groove','Rock music festival','4232a St Laurent Blvd, Montreal, QC H2W 1Z3','http://www.tourisme-montreal.org/blog/wp-content/uploads/2014/07/TM-MEG2014-crowd-stage.jpg','2017-04-06 22:15:34','2017-04-06 22:15:34',45.5182740,-73.5823270,'4.5');
